import React from "react";
import './headercss.css'
import logoTSUTiny from './Group 39.svg'

class LogoTiny extends React.Component{
    render() {
        return(
            <div>
                <img src={logoTSUTiny}/>
                <span>Привет</span>
            </div>
        )
    }
}

export default LogoTiny;
